import './App.css';
import React from 'react';
import HomePage from './page/HomePage/HomePage';
import Header from './component/Header';
import Footer from './component/Footer';

function App() {
  return (
    <div>
        <Header/>
        <HomePage></HomePage>
        <Footer/>
    </div>
  );
}

export default App;
